import React from 'react'

const Book = () => {
  return (
    <div className="book">
      <section>
        <div className="bookcontainer">
            <h1 className="bookname">Events</h1>
            <div className="books">
                {
                    books.map((bcard, i) => (

                        <div key={i} className="cardcard">
                            <h3 className="cardname">{bcard.title}</h3>
                            {/* <img className="piccard" src={card.pic} alt="" /> */}
                            <span className="ptext">{bcard.text}</span>
                            <button className="cardbtn">Explore</button>
                        </div>

                    ))
                }
                
            </div>

        </div>
      </section>
    </div>
  )
}

export default Book
